import image from './2023.png';
import './nav.css';
function Nav(){
    return (
        <>
        <div className="nav-box">
          <div className="logo">
            <img className="img" src={image}/>
            <a href="" className="txt">Home</a>
            <a href="" className="txt">about</a>
            <input className="search" placeholder="Search..."/>
          </div>
          
        </div>
        </>
    );
}
export default Nav;
